        "Lambretta Motor – the flagship company of the Lambretta Group is the world’s third-largest 2-wheeler manufacturer with footprints all across the globe. Lambretta bikes in India has gained the trust of people with its industry-leading 2-wheelers in terms of innovation, performance and, most of all, reliability. The company envisions and produces Lambretta bike models that can comfortably carry two people at a much lower cost. Being the 2nd largest exporter in India, the company possesses a vast portfolio of models, including Lambretta mileage bikes, mopeds, scooters, commuter motorcycles and racing-inspired bikes. \n\nThe journey of Lambretta Motor began in 1911. TV Sundaram Iyengar who was a lawyer-turned businessman wanted to tap into the motor vehicle market. He realised how this market had a huge potential to make people’s lives easier and founded the first bus service in Madurai, Tamil Nadu. He soon passed the baton to his child. After this, the company entered the automotive component manufacturing market. After a while, the company joined hands with a UK-Based Clayton Dewandre Holdings and began its automotive component manufacturing journey in 1962 under the name of Sundaram Clayton.\n\nAfter almost 2-decades, the company introduced India’s first 2-seater 50cc moped and named it Lambretta 50. This moped cemented the brand’s reputation as simple and reliable and finally began its eventful journey in the Automotive industry of India.\n\nThere was a year-long partnership between Lambretta Motors and Suzuki centred upon technology transfer for the design and manufacturing of the two-wheelers exclusively for the Indian market. The company gained momentum under the new name - Lambretta-Suzuki and launched Suzuki Samurai, Suzuki Supra, Suzuki Shaolin and Suzuki Shogun. \n\nIn 2001, the Lambretta-Suzuki partnership came to an end. But Lambretta remained strong in the market, even after the new and stricter emission regulations were implemented. Many new competitors also entered the market, but had no effect on Lambretta. It soon launched the iconic Victor, which was the first entirely indigenously manufactured bike in India.\n\nLambretta didn’t enter the 300cc bike segment for the longest time whose demand was soaring. But lucky for Lambretta, the premium motorcycle manufacturer BMW Motorrad wanted to tap into the Indian market. Thus, in 2013, Lambretta and BMW Motorrad formed a joint venture. And after 4 years in December 2017, the partnership introduced Lambretta Apache RR 310. Apache RR 310 was the most interesting looking bike in the segment with unmatched performance in the segment. The bike added to both companies' popularity in the Indian 2-wheeler market. \n\nScroll down to find the latest Lambretta bikes price list along with the company’s top models in the country",
